// Default imports
import React from 'react';

// Custom imports
import {NavLink} from "react-router-dom";
import './navbar.css';
import Favicon from '../../assets/favicon.png';
import Person from '../../assets/IMG_2778.jpg';

const Nav = () => {
    const M = window.M;
    document.addEventListener('DOMContentLoaded', function () {
        const elements = document.querySelectorAll('.sidenav');
        M.Sidenav.init(elements, {});
    });
    return (
        // HTML here
        <div>
            <nav>
                <div className="nav-wrapper">
                    <button data-target="mobile-demo" className="sidenav-trigger show-on-large"><i
                        className="material-icons">menu</i></button>
                </div>
            </nav>

            <ul className="sidenav" id="mobile-demo">
                <li>
                    <div className="user-view">
                        <div className="background">
                            <img alt='person' src={Person}/>
                        </div>
                        <img alt='initials' className="circle" src={Favicon}/>
                        <span className="name black-text">Neerav Panchal</span>
                        <span className="email black-text">masterpanchieneerav@gmail.com</span>
                    </div>
                </li>
                <li><NavLink to="/"><i className="material-icons left">home</i>Home</NavLink></li>
                <li><NavLink to="/about"><i className="material-icons left">info</i>About</NavLink></li>
                <li><NavLink to="/portfolio"><i className="material-icons left">work</i>Portfolio</NavLink></li>
                <li><NavLink to="/contact"><i className="material-icons left">phone</i>Contact</NavLink></li>
            </ul>
        </div>
    )
};

// Default export
export default Nav;
